import React from "react";

const FilterBar = ({ handleFilter, classes }) => {
  return (
    <div className="FilterBar">
      <p>Filter by class:</p>
      <select multiple onChange={handleFilter}>
        {classes.map((botClass, index) => (
          <option key={index} value={botClass}>
            {botClass}
          </option>
        ))}
      </select>
    </div>
  );
};

export default FilterBar;
